script: |
  super -f text -I q12868.spq | sort > q12868.out

inputs:
  - name: q12868.spq
    data: |
      SELECT col0 + + + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE + + 53 NOT BETWEEN 30 AND - col1 + - col0 / + + col1;
  - name: tab0

outputs:
  - name: q12868.out
    data: |
      196
      62
      97
